function Mainpage() {
  return (

    <>
      
      <Navebar/>
    <div className='container1'>
      
        <Sidebar />
         
            <Route exact path='/mainpage'>
            </Route>
            <Route  path = '/mainpage/Home'>
                <Contente/>
            </Route>
          
    
      </div>
    </>
      
  )
}

export default Mainpage
